  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0113602 includes chemical,
  discrete sample, physical and profile data collected from TYRO in the North Atlantic
  Ocean from 1990-07-01 to 1990-07-12 and retrieved during cruise CARINA/64TR19900701.
  These data include DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN, HYDROSTATIC PRESSURE,
  NITRATE, NITRITE, PHOSPHATE, Potential temperature (theta), SALINITY, SILICATE,
  TRITIUM and WATER TEMPERATURE. The instruments used to collect these data include
  CTD and bottle. These data were collected by M. Stoll of Commonwealth Scientific
  and Industrial Research Organization and H.M. van Aken [affiliation unknown] as
  part of the CARINA/64TR19900701 data set.nnThe CARINA (CARbon dioxide IN the Atlantic
  Ocean) data synthesis project is an international collaborative effort of the EU
  IP CARBOOCEAN, and U.S. partners. It has produced a merged internally consistent
  data set of open ocean subsurface measurements for biogeochemical investigations,
  in particular, studies involving the carbon system. The original focus area was
  the North Atlantic Ocean, but over time the geographic extent expanded and CARINA
  now includes data from the entire Atlantic, the Arctic Ocean, and the Southern Ocean.\",\n\t\"license_title\":
